import React from 'react'
import '../index.css'
import '../Important Pages/LineRiderGame.css'

function Ball(props) {
    return (
        <img src= "https://clipart.info/images/ccovers/1495749720Bowling-Ball-PNG-Clip-Art.png"
        style= {{height: this.state.ballSize, 
            top: props.yPos}} 
            id= "ball-image"
            className = 'Ball'
            alt = "ball"/>
    )
}

export default Ball
